import { Container, Row } from "react-bootstrap";

function ForTest(){
    return(
        <Container fluid>
            <Container>
                <Row>
                    <Col>
                    <h1 className = "text-muted">Lorem ipsum dolor</h1>
                    <p>Lorem ipsum dolor Lorem ipsum dolor</p>
                    </Col>
                </Row>
            </Container>
        </Container>
    )
}

export default ForTest
